  \"2015-09-26T20:06:50.799224\",\n\t\"name\": \"noaa-office-for-coastal-management-sea-level-rise-data-current-mean-higher-high-water-inundatio\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These data were created as part of the
  National Oceanic and Atmospheric Administration Office for Coastal Management's
  efforts to create an online mapping viewer depicting potential sea level rise and
  its associated impacts on the nation's coastal areas. The purpose of the mapping
  viewer is to provide coastal managers and scientists with a preliminary look at
  sea level rise (slr) and coastal flooding impacts. The viewer is a screening-level
  tool that uses nationally consistent data sets and analyses. Data and maps provided
  can be used at several scales to help gauge trends and prioritize actions for different
  scenarios. The Sea Level Rise and Coastal Flooding Impacts Viewer may be accessed
  at: http://www.coast.noaa.gov/slr. These data depict the potential inundation of
  coastal areas in Hawaii resulting from current Mean Higher High Water (MHHW) conditions.
  The process used to produce the data can be described as a modified bathtub approach
  that attempts to account for both local/regional tidal variability as well as hydrological
  connectivity. The process uses two source datasets to derive the final inundation
  rasters and polygons and accompanying low-lying polygons: the Digital Elevation
  Model (DEM) of the area and a tidal surface model that represents spatial tidal
  variability. The tidal model combines harmonic constituents, tidal datums, and residual
  water level data measured at tide stations into a composite tide curve. This solution
  is not a NOAA/CO-OPS-generated/recognized tidal-geodetic relationship. The tidal
  datum values were interpolated from published values using a 2-D mathematical interpolation
  model that solves for weighting functions that satisfy the Laplacian. This strictly
  mathematical approach assumes a smooth transition of tidal characteristics and the
  quality control step entailed comparing the interpolated values with other known
  values not included in the interpolation model. This derived surface is used in
  lieu of NAVD88 coverage in the Hawaiian Islands for the purposes of this project.
  The model used to produce these data does not account for erosion, subsidence, or
  any future changes in an area's hydrodynamics. It is simply a method to derive data
  in order to visualize the potential scale, not exact location, of inundation from
  sea level rise.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
